import React from 'react';

const UsuarioEntrada = (props) => {
  return (
    <div>
      <label>Nome de Usuário:</label>
      <input
        type="text"
        onChange={props.onChange}
        value={props.username}
      />
    </div>
  );
};

export default UsuarioEntrada;
